import{_ as a,c as d,a as t,e as o,r as i,o as c}from"./app.109432a7.js";const m=JSON.parse('{"title":"\uB098\uC758 \uACE0\uB4F1\uD559\uAD50 \uAE30\uB2A5\uBC18 \uC0DD\uD65C1","description":"","frontmatter":{"title":"\uB098\uC758 \uACE0\uB4F1\uD559\uAD50 \uAE30\uB2A5\uBC18 \uC0DD\uD65C1","createBy":"2022-06-29T00:00:00.000Z"},"headers":[{"level":2,"title":"\uACE0\uB4F1\uD559\uAD50 \uC815\uD558\uAE30","slug":"\uACE0\uB4F1\uD559\uAD50-\uC815\uD558\uAE30"},{"level":2,"title":"\uACE0\uB4F1\uD559\uAD50 \uC9C4\uD559","slug":"\uACE0\uB4F1\uD559\uAD50-\uC9C4\uD559"},{"level":2,"title":"\uAE30\uB2A5\uBC18 \uC0DD\uD65C\uC5D0 \uC801\uC751\uD558\uAE30","slug":"\uAE30\uB2A5\uBC18-\uC0DD\uD65C\uC5D0-\uC801\uC751\uD558\uAE30"},{"level":2,"title":"\uCCAB\uBC88\uC9F8 \uC9C0\uBC29\uB300\uD68C","slug":"\uCCAB\uBC88\uC9F8-\uC9C0\uBC29\uB300\uD68C"},{"level":2,"title":"\uC9C0\uBC29\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C\uB780?","slug":"\uC9C0\uBC29\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C\uB780"},{"level":2,"title":"\uC9C0\uBC29\uB300\uD68C\uAC00 \uB05D\uB09C \uD6C4","slug":"\uC9C0\uBC29\uB300\uD68C\uAC00-\uB05D\uB09C-\uD6C4"},{"level":2,"title":"\uAE30\uB2A5\uBC18 \uD6C4\uBC30\uB4E4\uC758 \uB4F1\uC7A5","slug":"\uAE30\uB2A5\uBC18-\uD6C4\uBC30\uB4E4\uC758-\uB4F1\uC7A5"}],"relativePath":"everyday/\uACE0\uB4F1\uD559\uAD50 \uC0DD\uD65C \uCCAB\uBC88\uC9F8 \uC774\uC57C\uAE30.md"}'),b={name:"everyday/\uACE0\uB4F1\uD559\uAD50 \uC0DD\uD65C \uCCAB\uBC88\uC9F8 \uC774\uC57C\uAE30.md"};function l(h,e,p,s,n,u){const r=i("Comment");return c(),d("div",null,[e[0]||(e[0]=t('<br><br><hr><p>\uC911\uD559\uAD50 3\uD559\uB144\uB54C\uBD80\uD130 \uACE0\uB4F1\uD559\uAD50 2\uD559\uB144 2\uD559\uAE30\uAE4C\uC9C0\uC758 \uC0DD\uD65C\uC744 \uC4F4 \uAE00\uC785\uB2C8\uB2E4. \uCC98\uC74C \uC368\uBCF4\uB294 \uAE00\uC774\uB77C\uC11C \uC880 \uB9CE\uC774 \uBBF8\uD761\uD558\uC9C0\uB9CC \uC7AC\uBC0C\uAC8C \uBD10\uC8FC\uC138\uC694.</p><hr><br><br><br><br><br><h1 id="\uAE30\uB2A5\uBC18\uC5D0-\uB4E4\uC5B4\uC624\uAE30\uAE4C\uC9C0\uC758-\uB098\uC758-\uC0DD\uD65C" tabindex="-1">\uAE30\uB2A5\uBC18\uC5D0 \uB4E4\uC5B4\uC624\uAE30\uAE4C\uC9C0\uC758 \uB098\uC758 \uC0DD\uD65C <a class="header-anchor" href="#\uAE30\uB2A5\uBC18\uC5D0-\uB4E4\uC5B4\uC624\uAE30\uAE4C\uC9C0\uC758-\uB098\uC758-\uC0DD\uD65C" aria-hidden="true">#</a></h1><br><h2 id="\uACE0\uB4F1\uD559\uAD50-\uC815\uD558\uAE30" tabindex="-1">\uACE0\uB4F1\uD559\uAD50 \uC815\uD558\uAE30 <a class="header-anchor" href="#\uACE0\uB4F1\uD559\uAD50-\uC815\uD558\uAE30" aria-hidden="true">#</a></h2><hr><p>\uB54C\uB294 \uBC14\uC57C\uD750\uB85C \uC911\uD559\uAD50 3\uD559\uB144 \uB54C \uC9C0\uAE08\uC73C\uB85C\uBD80\uD130 3\uB144 \uC804 \uB098\uB294 \uC778\uC0DD\uC758 \uCCAB \uBC88\uC9F8 \uACE0\uBBFC \uC704\uC5D0 \uC11C\uC788\uC5C8\uB2E4. \uADF8\uAC83\uC740 \uBC14\uB85C \uACE0\uB4F1\uD559\uAD50 \uC9C4\uD559\uC744 \uC778\uBB38\uACC4\uB85C \uAC08 \uAC83\uC774\uB0D0? \uD2B9\uC131\uD654\uACE0\uB85C \uAC08 \uAC83\uC774\uB0D0? \uC774\uAC83\uC73C\uB85C \uD55C\uCC3D \uACE0\uBBFC\uD558\uACE0 \uC788\uC744 \uB54C\uC600\uB2E4. \uC194\uC9C1\uD788 \uADF8\uB54C \uB2F9\uC2DC \uB098\uB294 \uACF5\uBD80\uB3C4 \uC5F4\uC2EC\uD788 \uD558\uB294 \uAC83\uB3C4 \uC544\uB2C8\uC5C8\uACE0 \uC778\uBB38\uACC4\uB85C \uAC00\uBD24\uC790 \uACF5\uBD80\uB3C4 \uC81C\uB300\uB85C \uD560 \uB9C8\uC74C\uC774 \uC5C6\uC5B4\uC11C \uACB0\uAD6D \uD2B9\uC131\uD654\uACE0\uB85C \uC9C4\uD559\uD558\uAE30\uB85C \uACB0\uC2EC\uD588\uB2E4. <br></p><p>\uCD08\uB4F1\uD559\uAD50 \uB54C \uB2E4\uB2CC \uCEF4\uD4E8\uD130\uB97C \uC880 \uBC30\uC6B4 \uAC8C \uC788\uC5B4\uC11C \uCEF4\uD4E8\uD130 \uAD00\uB828 \uD2B9\uC131\uD654\uACE0\uB4E4\uC744 \uCC3E\uC544\uBCF4\uB2C8 <code>\uC120\uB9B0\uC778\uD130\uB137\uACE0\uB4F1\uD559\uAD50</code>, <code>\uC138\uBA85\uCEF4\uD4E8\uD130\uACE0\uB4F1\uD559\uAD50</code>, <code>\uD55C\uC138\uC0AC\uC774\uBC84\uACE0\uB4F1\uD559\uAD50</code> \uC774 \uC138 \uACF3\uC774 \uC788\uC5C8\uB2E4. \uD558\uC9C0\uB9CC \uACE0\uBBFC\uD558\uB294\uB370 \uC2DC\uAC04\uC744 \uB108\uBB34 \uC0AC\uC6A9\uD55C \uD0D3\uC778\uC9C0 \uC774 3\uAC1C\uC758 \uACE0\uB4F1\uD559\uAD50\uC758 \uC785\uD559\uC124\uBA85\uD68C\uB294 \uB2E4 \uB05D\uC774 \uB0AC\uC5C8\uACE0 \uB098\uB294 \uC785\uD559\uC6D0\uC11C\uB9CC \uB123\uC744 \uC0DD\uAC01\uC73C\uB85C \uC544\uBB34 \uC0DD\uAC01 \uC5C6\uC774 \uB0A8\uC740 \uD559\uAD50\uC0DD\uD65C\uC744 \uBCF4\uB0B4\uACE0 \uC788\uC5C8\uB2E4. <br></p><p>2\uD559\uAE30 \uAE30\uB9D0\uACE0\uC0AC\uAC00 \uB05D\uB09C \uC911\uD559\uAD50 3\uD559\uB144\uB4E4\uC740 \uC218\uC5C5\uC744 \uD558\uC9C0 \uC54A\uC558\uB2E4. \uC801\uC5B4\uB3C4 \uC6B0\uB9AC \uD559\uAD50\uB294. \uC774\uC81C \uACF5\uBD80\uD560 \uAC83\uB3C4 \uC5C6\uACE0 \uACE0\uB4F1\uD559\uAD50 \uD64D\uBCF4\uB3C4 \uC640\uC11C \uBA87\uBA87 \uC120\uC0DD\uB2D8\uB4E4\uC744 \uC81C\uC678\uD558\uACE4 \uAC70\uC758 \uC218\uC5C5\uC2DC\uAC04\uC5D0 \uC218\uC5C5\uC744 \uD558\uC9C0 \uC54A\uACE0 \uC601\uD654\uB97C \uBCF4\uAC70\uB098 \uB180\uC558\uC5C8\uB2E4. <br><br></p><p><img src="https://user-images.githubusercontent.com/71883310/176349038-52a5d17a-011f-4de0-a889-5bbbbe920f53.png" alt="\uD654\uBA74 \uCEA1\uCC98 2022-06-29 130340"></p><p>\uADF8\uB0A0\uC740 \uD3C9\uC18C\uCC98\uB7FC \uC544\uBB34 \uC0DD\uAC01 \uC5C6\uC774 \uAD50\uC2E4\uC5D0\uC11C \uC601\uD654\uB97C \uBCF4\uACE0 \uC788\uC5C8\uB294\uB370 \uACE0\uB4F1\uD559\uAD50 \uD64D\uBCF4\uD558\uB7EC <code>\uC11C\uC6B8\uB514\uC9C0\uD14D\uACE0\uB4F1\uD559\uAD50</code> \uC120\uBC30\uB4E4\uC774 \uB4E4\uC5B4\uC624\uACE0 \uD559\uAD50 \uC124\uBA85\uC744 \uD55C \uB4A4 \uB2E4\uBAA9\uC801\uC2E4(\uACE0\uB4F1\uD559\uAD50 \uD64D\uBCF4 \uBB38\uC81C\uB85C \uC0C1\uB2F4 \uD558\uB358 \uACF3)\uC5D0\uC11C \uAE30\uB2E4\uB9AC\uACE0 \uC788\uACA0\uB2E4\uACE0 \uC0C1\uB2F4\uBC1B\uC73C\uB85C \uC624\uB77C\uACE0 \uD558\uC600\uB2E4. \uD55C 5~10\uBD84 \uC815\uB3C4 \uACE0\uBBFC\uD558\uACE0 \uB098\uC11C \uC774 \uC0C1\uB2F4\uBC1B\uC73C\uB85C \uAC14\uC5C8\uB294\uB370 \uB2E4\uBAA9\uC801\uC2E4\uB85C \uAC00\uBCF4\uB2C8 \uC120\uBC30\uB4E4\uC740 \uBC8C\uC368\uAC00\uACE0 \uC5C6\uC5C8\uB2E4. \uADF8\uB54C \uAE30\uBD84\uC774 \uCC38... <br><br></p><p>\uC544\uBB34\uD2BC \uB098\uB294 \uC774 \uD559\uAD50\uAC00 \uB9C8\uC74C\uC5D0 \uB4E4\uC5B4\uC11C \uC120\uC0DD\uB2D8\uAED8 \uB9D0\uD558\uACE0 \uC785\uD559\uC6D0\uC11C\uB97C \uB123\uAC8C \uB410\uC5C8\uB2E4. <code>\uC11C\uC6B8\uB514\uC9C0\uD14D\uACE0\uB4F1\uD559\uAD50</code>\uC5D0 \uC785\uD559\uC6D0\uC11C\uB97C \uB123\uC73C\uB2C8\uAE4C \uC5B4\uB290 \uD55C \uC120\uC0DD\uB2D8\uAED8\uC11C \uC911\uD559\uAD50\uC5D0\uC11C \uC774 \uD559\uAD50\uC5D0 \uAC04 <code>\uC120\uBC30</code> \uD55C \uBA85\uC774 \uC788\uB294\uB370 \uCDE8\uC5C5\uB3C4 \uC131\uACF5\uD588\uACE0 \uD559\uAD50\uC0DD\uD65C\uB3C4 \uC798\uD558\uACE0 \uC788\uB2E4\uACE0 \uADF8 \uC120\uBC30 \uC5F0\uB77D\uCC98\uB97C \uC54C\uB824\uC8FC\uC168\uB2E4. \uB2F9\uC2DC\uC5D0\uB294 \uADF8\uB0E5 \uC5F0\uB77D\uCC98\uB9CC \uC800\uC7A5\uD574 \uB193\uACE0 \uADF8\uB0E5 \uD3C9\uC18C\uB300\uB85C \uD559\uAD50\uC0DD\uD65C\uC744 \uD558\uC600\uB2E4. \uADF8\uB54C\uAC00 \uC911\uD559\uAD50 3\uD559\uB144 \uB54C\uC600\uB294\uB370 \uC5F0\uB9D0\uC778\uAC00? \uC815\uD655\uD788 \uAE30\uC5B5\uB098\uC9C0\uB294 \uC54A\uB294\uB370 \uB9C8\uC9C0\uB9C9\uC73C\uB85C \uD558\uB294 \uC785\uD559\uC124\uBA85\uD68C\uAC00 \uB0A8\uC544 \uC788\uC5C8\uB2E4. \uADF8\uB798\uC11C \uC774 \uD559\uAD50\uC5D0 \uB098\uB791 \uAC19\uC774 \uC9C0\uC6D0\uD55C \uCE5C\uAD6C\uB791 \uAC19\uC774 \uD559\uAD50\uC5D0\uC11C \uB098\uC640 \uC810\uC2EC\uC744 \uBA39\uC740 \uB4A4 \uC785\uD559 \uC124\uBA85\uD68C\uB97C \uB4E4\uC73C\uB7EC \uD559\uAD50\uB97C \uB5A0\uB0AC\uB2E4. <br></p><p>\uC6D0\uB798\uB294 \uBC84\uC2A4\uB85C \uAC08\uC544\uD0C0\uC11C \uAC00\uB824\uACE0 \uD588\uB294\uB370 \uCD08\uD589\uAE38\uC774\uC5B4\uC11C \uBC84\uC2A4 \uC815\uB958\uC7A5\uC744 \uBABB\uCC3E\uC544\uC11C 20\uBD84 \uC815\uB3C4 <code>\uC9C0\uAC01</code>\uC744 \uD588\uB2E4... <br> \uAC00\uC11C \uD55C 10\uBD84\uC815\uB3C4 \uC549\uC544\uC11C \uC124\uBA85\uD68C\uB97C \uB4E4\uC73C\uB2C8 \uC124\uBA85\uD68C\uB294 \uB05D\uB0AC\uACE0 \uB098\uB294 \uADF8\uB807\uAC8C \uC9D1\uC73C\uB85C \uB3CC\uC544\uC654\uB2E4. <br><br></p><h2 id="\uACE0\uB4F1\uD559\uAD50-\uC9C4\uD559" tabindex="-1">\uACE0\uB4F1\uD559\uAD50 \uC9C4\uD559 <a class="header-anchor" href="#\uACE0\uB4F1\uD559\uAD50-\uC9C4\uD559" aria-hidden="true">#</a></h2><hr><p>\uACE0\uB4F1\uD559\uAD50 \uD569\uACA9\uC790 \uBC1C\uD45C\uAC00 \uB098\uACE0 \uB098\uB294 \uC11C\uC6B8\uB514\uC9C0\uD14D\uACE0\uB4F1\uD559\uAD50\uB97C \uB2E4\uB2C8\uAC8C \uB418\uC5C8\uB2E4. \uADF8\uB7F0\uB370 \uB9C8\uCE68 \uADF8\uD574\uC5D0 <code>\uCF54\uB85C\uB098\uBC14\uC774\uB7EC\uC2A4</code>\uAC00 \uD130\uC9C0\uACE0 \uC218\uC5C5\uC774 \uC628\uB77C\uC778 \uC218\uC5C5\uC73C\uB85C \uB300\uCCB4 \uB418\uC5C8\uACE0 \uC6B0\uB9AC \uD559\uB144\uC740 6\uC6D4\uC5D0 \uCC98\uC74C\uC73C\uB85C \uD559\uAD50\uC5D0 \uB4F1\uAD50\uD558\uAC8C \uB418\uC5C8\uB2E4. \uC911\uD559\uAD50\uC5D0\uC11C \uACE0\uB4F1\uD559\uAD50\uB85C \uC62C\uB77C\uC624\uB2C8\uAE4C \uB9CE\uC740\uAC8C \uBC14\uB00C\uC5C8\uB2E4. \uAC00\uC7A5 \uD070 \uBCC0\uD654\uB294 \uB4F1\uAD50 \uC2DC\uAC04\uC774 10\uBD84\uC5D0\uC11C 1\uC2DC\uAC04\uC73C\uB85C \uB298\uC5B4\uB09C \uAC83\uACFC \uC804\uACF5 \uB3D9\uC544\uB9AC\uAC00 \uC788\uB2E4\uB294 \uAC83\uC5C8\uB2E4. \uB098\uB3C4 \uC804\uACF5 \uB3D9\uC544\uB9AC\uC5D0 \uB4E4\uC5B4\uAC00\uB824\uACE0 \uB3D9\uC544\uB9AC\uB4E4\uC744 \uC54C\uC544\uBCF4\uB2C8 \uAC19\uC740 \uC911\uD559\uAD50 \uC120\uBC30\uAC00 \uB9CC\uB4E0 \uB3D9\uC544\uB9AC\uAC00 \uC788\uB2E4\uBA70 \uB4E4\uC5B4\uC624\uB77C\uACE0 \uD558\uC5EC\uC11C <code>MC</code>\uB77C\uB294 \uB3D9\uC544\uB9AC\uC5D0 \uCC98\uC74C\uC73C\uB85C \uAC00\uC785\uD558\uAC8C \uB418\uC5C8\uB2E4. <br></p><p>\uADF8\uB807\uAC8C \uC544\uBB34\uC0DD\uAC01 \uC5C6\uC774 \uBC18\uB144\uC774\uB780 \uC2DC\uAC04\uB3D9\uC548 \uD559\uAD50\uC0DD\uD65C\uC744 \uBCF4\uB0B4\uACE0 \uC788\uB294 \uCC30\uB098 \uD559\uAE30 \uB9D0\uC5D0 <code>\uAE30\uB2A5\uBC18</code>\uC774\uB780 \uAC83\uC744 \uC54C\uAC8C \uB418\uC5C8\uB2E4. \uAE30\uB2A5\uBC18\uC5D0 \uB300\uD574\uC11C \uC124\uBA85\uC744 \uB4E4\uC5C8\uB294\uB370 \uAE30\uB2A5\uB300\uD68C\uC5D0 \uB098\uAC00\uAE30 \uC704\uD574\uC11C \uB9CC\uB4E4\uC5B4\uC9C4 \uC2EC\uD654 \uB3D9\uC544\uB9AC \uBE44\uC2B7\uD55C \uAC70\uB77C\uACE0 \uB4E4\uC5C8\uB2E4. \uC6D0\uB798\uB294 1\uD559\uAE30 \uB9D0\uC774\uB098 2\uD559\uAE30 \uCD08\uC5D0 \uAE30\uB2A5\uBC18\uC744 \uBAA8\uC9D1\uD558\uB294\uB370 \uCF54\uB85C\uB098 \uBB38\uC81C\uB3C4 \uC788\uACE0 \uB2F4\uB2F9 \uC120\uC0DD\uB2D8\uC774 \uBC14\uC058\uC154\uC11C 10\uC6D4\uC5D0 \uBAA8\uC9D1\uD558\uAC8C \uB418\uC5C8\uB2E4\uD55C\uB2E4. \uB098\uB3C4 \uC6F9\uB514\uC790\uC778 \uAE30\uB2A5\uBC18\uC5D0 \uB4E4\uC5B4\uAC00\uACE0 \uC2F6\uC5B4\uC11C \uC9C0\uC6D0\uD588\uACE0 \uC608\uBE44 \uAE30\uB2A5\uBC18\uC774 \uB418\uC5C8\uB2E4. \uC608\uBE44 \uC0DD\uD65C\uC744 \uD558\uBA74\uC11C \uC911\uAC04\uC5D0 \uD798\uB4E4\uC5B4\uC11C \uB098\uAC00\uB824\uACE0\uB3C4 \uD588\uC9C0\uB9CC, \uC6B0\uC5EC\uACE1\uC808 \uB05D\uC5D0 \uD55C \uB2EC\uC774\uB780 \uC2DC\uAC04\uC774 \uC9C0\uB0AC\uB2E4. \uCC98\uC74C\uC5D0\uB294 \uB098\uB97C \uD3EC\uD568\uD574\uC11C 6\uBA85\uC815\uB3C4 \uC608\uBE44 \uAE30\uB2A5\uBC18 \uC598\uB4E4\uC774 \uC788\uC5C8\uB294\uB370 \uD798\uB4E4\uB2E4\uACE0 \uB098\uAC00\uAE30\uB3C4 \uD558\uACE0 \uCAD3\uACA8\uB098\uAE30\uB3C4 \uD558\uACE0 \uD55C\uB2EC \uC815\uB3C4 \uC9C0\uB098\uB2C8\uAE4C \uB098\uB791 \uC900\uC11C\uB77C\uB294 \uCE5C\uAD6C \uBC16\uC5D0 \uC548 \uB0A8\uC558\uB2E4. \uC544\uBB34\uD2BC \uADF8\uB807\uAC8C \uB098\uB791 \uC900\uC11C\uAC00 11\uC6D4\uB2EC\uC5D0 \uC608\uBE44\uC5D0\uC11C <code>\uC815\uC2DD \uAE30\uB2A5\uBC18</code>\uC774 \uB418\uC5C8\uB2E4. <br><br><br><br><br></p><h1 id="\uAE30\uB2A5\uBC18-\uC0DD\uD65C\uC758-\uC2DC\uC791" tabindex="-1">\uAE30\uB2A5\uBC18 \uC0DD\uD65C\uC758 \uC2DC\uC791 <a class="header-anchor" href="#\uAE30\uB2A5\uBC18-\uC0DD\uD65C\uC758-\uC2DC\uC791" aria-hidden="true">#</a></h1><h2 id="\uAE30\uB2A5\uBC18-\uC0DD\uD65C\uC5D0-\uC801\uC751\uD558\uAE30" tabindex="-1">\uAE30\uB2A5\uBC18 \uC0DD\uD65C\uC5D0 \uC801\uC751\uD558\uAE30 <a class="header-anchor" href="#\uAE30\uB2A5\uBC18-\uC0DD\uD65C\uC5D0-\uC801\uC751\uD558\uAE30" aria-hidden="true">#</a></h2><hr><p>11\uC6D4\uC5D0 \uAE30\uB2A5\uBC18\uC758 \uD569\uACA9\uD558\uACE0 \uC5BC\uB9C8 \uB4A4 \uAE30\uB2A5\uBC18 \uC0DD\uD65C\uC744 \uD558\uBA74\uC11C \uB3D9\uC544\uB9AC\uB97C \uAC19\uC774\uD560 \uC218\uAC00 \uC5C6\uB2E4\uBA70 \uC6D0\uB798 \uC788\uB358 \uB3D9\uC544\uB9AC\uC5D0\uC11C <code>\uCAD3\uACA8\uB0AC\uB2E4</code>. \uB3D9\uC544\uB9AC \uC785\uC7A5\uC5D0\uC11C \uD65C\uB3D9\uB3C4 \uC548 \uD558\uB294 \uC598\uB97C \uACC4\uC18D \uB0A8\uAE38 \uC218\uB3C4 \uC5C6\uC73C\uB2C8 \uB2F9\uC5F0\uD55C \uAC70\uACA0\uC9C0\uB9CC... \uCC98\uC74C\uC5D0\uB294 \uAE30\uB2A5\uBC18 \uC0DD\uD65C\uC774 \uC815\uB9D0 \uC8FD\uC744 \uB9DB\uC774\uC5C8\uB2E4. \uC544\uCE68 6\uC2DC\uC5D0 \uC77C\uC5B4\uB098\uC11C \uC53B\uACE0 \uD559\uAD50 \uAC00\uC11C \uAE30\uB2A5\uBC18\uAE4C\uC9C0 \uD558\uACE0 \uC9D1\uC5D0 \uC624\uBA74 \uC800\uB141 10\uC2DC \uBC18 \uC815\uB3C4\uC600\uC73C\uB2C8... \uADF8\uBFD0\uB9CC\uC774 \uC544\uB2C8\uB77C \uC120\uBC30\uB4E4\uC774 \uACC4\uC18D \uACFC\uC81C\uB97C \uC918\uC11C \uC9D1\uC5D0 \uC640\uC11C\uB3C4 \uACFC\uC81C\uB97C \uD480\uB2E4 \uC794 \uC801\uB3C4 \uB9CE\uC558\uB2E4. \uCD08\uBC18\uC5D0\uB294 \uD53C\uACE4\uD574\uC11C \uAC70\uC758 \uB9E4\uC77C \uCF54\uD53C\uAC00 \uB0AC\uB358 \uAC83 \uAC19\uB2E4. \uAE30\uB2A5\uBC18\uC740 \uBC29\uD559\uC5D0\uB3C4 \uB098\uAC14\uB294\uB370 \uBC29\uD559\uC5D0\uB3C4 \uD559\uAD50\uC5D0 \uAC00\uC11C \uACF5\uBD80\uD558\uB2C8\uAE4C \uADF8\uB54C \uC2E4\uB825\uC740 \uB9CE\uC774 \uB298\uC5C8\uB358 \uAC83 \uAC19\uB2E4.</p><br><br><h2 id="\uCCAB\uBC88\uC9F8-\uC9C0\uBC29\uB300\uD68C" tabindex="-1">\uCCAB\uBC88\uC9F8 \uC9C0\uBC29\uB300\uD68C <a class="header-anchor" href="#\uCCAB\uBC88\uC9F8-\uC9C0\uBC29\uB300\uD68C" aria-hidden="true">#</a></h2><hr><p>2\uD559\uB144\uC774 \uB418\uACE0 4\uC6D4\uB2EC\uC5D0 \uCC98\uC74C\uC73C\uB85C <code>\uC9C0\uBC29\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C</code>\uAC00 \uC5F4\uB838\uB2E4. \uB300\uD68C \uC2DC\uC791 15\uC77C\uC804\uC5D0 \uBB38\uC81C\uAC00 \uACF5\uAC1C \uB418\uC5C8\uB294\uB370 \uC120\uC0DD\uB2D8\uAED8\uC11C \uAC15\uC0AC\uB85C \uC878\uC5C5\uD558\uC2E0 \uAE30\uB2A5\uBC18 \uC120\uBC30\uB97C \uBD88\uB7EC \uC8FC\uC168\uB2E4. \uADF8\uB54C \uB2F9\uC2DC\uC5D0\uB294 \uB300\uD68C\uC900\uBE44\uB85C \uC120\uC0DD\uB2D8\uB3C4 9\uC2DC\uAE4C\uC9C0 \uAE30\uB2A5\uBC18\uC5D0 \uB0A8\uC544 \uACC4\uC168\uACE0, \uBC25\uBA39\uB294 \uC2DC\uAC04\uC740 \uC81C\uC678\uD558\uBA74 \uAC70\uC758 \uBAA8\uB4E0 \uC2DC\uAC04\uC744 \uBB38\uC81C \uD480\uAC70\uB098 \uCF54\uB4DC \uC678\uC6B0\uB294 \uC2DC\uAC04\uC774\uC5C8\uAE30\uC5D0 \uD3C9\uC18C\uBCF4\uB2E4 \uB354\uC6B1\uB354 \uBD84\uC704\uAE30\uAC00 \uBB34\uAC70\uC6E0\uB2E4. \uB2F9\uC2DC\uC5D0 \uB098\uB294 2\uD559\uB144\uC774\uACE0 \uC120\uBC30\uB4E4\uB3C4 \uC788\uC73C\uB2C8 \uB9C8\uC74C \uD3B8\uD788 \uB300\uD68C\uB97C \uC900\uBE44\uD560 \uC218 \uC788\uC5C8\uC9C0\uB9CC \uC120\uBC30\uB4E4\uC740 \uAC00\uC11C \uC785\uC0C1\uC744 \uD574\uC57C\uD558\uAE30 \uB54C\uBB38\uC5D0 \uADF8\uB7F4 \uC5EC\uC720\uAC00 \uC5C6\uC5C8\uB2E4. <br></p><h2 id="\uC9C0\uBC29\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C\uB780" tabindex="-1">\uC9C0\uBC29\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C\uB780? <a class="header-anchor" href="#\uC9C0\uBC29\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C\uB780" aria-hidden="true">#</a></h2><hr><div class="tip custom-block"><p class="custom-block-title">TIP</p><ul><li><p>\uC9C0\uBC29\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C\uB294 \uC6B0\uC218\uD55C \uC219\uB828\uAE30\uC220\uC778\uC744 \uBC1C\uAD74\xB7\uD45C\uCC3D\uD574 \uC219\uB828\uAE30\uC220\uC778\uB4E4\uC758 \uC0AC\uAE30\uB97C \uC9C4\uC791\uC2DC\uD0A4\uACE0 \uADFC\uB85C\uC758\uC695\uC744 \uACE0\uCDE8\uD558\uBA70 \uC9C0\uC5ED\uC0AC\uD68C\uC758 \uAE30\uB2A5 \uAC1C\uBC1C \uBC0F \uBCF4\uAE09, \uAE30\uB2A5 \uC218\uC900 \uD5A5\uC0C1\uC744 \uB3C4\uBAA8\uD558\uAE30 \uC704\uD574 \uC804\uAD6D 17\uAC1C \uC2DC\uB3C4 \uC8FC\uCD5C\uB85C \uB9E4\uB144 \uBD04 \uC2E4\uC2DC\uB418\uACE0 \uC788\uB294 \uB300\uD68C\uC774\uB2E4.</p></li><li><p>\uC9C0\uBC29\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C \uC785\uC0C1\uC790(1~ 3\uB4F1)\uC5D0\uAC8C\uB294 \uC0C1\uC7A5 \uBC0F \uBA54\uB2EC, \uC0C1\uAE08\uC774 \uC218\uC5EC\uB418\uBA70, \uAC19\uC740 \uD574 \uC5F4\uB9AC\uB294 \uC804\uAD6D\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C \uCD9C\uC804\uC790\uACA9\uC774 \uC8FC\uC5B4\uC9C4\uB2E4. \uD574\uB2F9 \uC9C1\uC885\uC5D0 \uD55C\uD574 \uAD6D\uAC00\uAE30\uC220\uC790\uACA9 \uAE30\uB2A5\uC0AC \uC2DC\uD5D8\uB3C4 \uBA74\uC81C \uBC1B\uC744 \uC218 \uC788\uB2E4.</p></li></ul></div><br><br><br><br><br><p><img src="https://user-images.githubusercontent.com/71883310/176356220-241cab66-26f4-4eb9-aa4a-be5b3849c59d.png" alt="\uD654\uBA74 \uCEA1\uCC98 2022-06-29 140717"><br></p><p>2021\uB144 4\uC6D4 5\uC77C \uC81C \uC778\uC0DD \uCCAB \uBC88\uC9F8 \uC9C0\uBC29\uB300\uD68C\uAC00 \uC2DC\uC791\uB418\uC5C8\uB2E4. \uC6D0\uB798\uB294 \uB300\uD68C\uC7A5\uC774 \uACBD\uAE30\uAE30\uACC4\uACF5\uC5C5\uACE0\uB4F1\uD559\uAD50\uC600\uB294\uB370 2021\uB144\uBD80\uD130 <code>\uB300\uC9C4\uB514\uC790\uC778\uACE0\uB4F1\uD559\uAD50</code>\uB85C \uBC14\uB00C\uC5C8\uB2E4. \uB300\uD68C\uB97C \uC9C4\uD589\uD558\uB294 1\uC8FC \uB3D9\uC548\uC740 \uD559\uAD50\uC5D0\uC11C \uC0C8\uBCBD\uAE4C\uC9C0 \uCF54\uB529\uD558\uB2E4 \uD559\uAD50 \uC55E\uC5D0 \uBAA8\uD154\uC744 \uC7A1\uC544\uC11C \uC790\uACE0 \uC77C\uC5B4\uB098\uC11C \uACBD\uAE30\uC7A5 \uAC00\uACE0 \uD574\uB2F9 \uACBD\uAE30\uAC00 \uB05D\uB09C \uB2E4\uC74C\uC5D0\uB294 \uB2E4\uC2DC \uD559\uAD50\uC5D0 \uC640\uC11C \uCF54\uB529\uD558\uACE0 \uC774\uB7EC\uD55C \uC0DD\uD65C\uC774 3~4\uC77C\uAC04 \uBC18\uBCF5\uB418\uC5C8\uB2E4. <br><br></p><ul><li>A : Design &amp; Publishing</li><li>B : Client-side Development</li><li>C : Server-side Development</li></ul><p>\uC6F9\uB514\uC790\uC778 \uBC0F \uAC1C\uBC1C \uC9C1\uC885 \uBB38\uC81C\uB294 A, B, C \uBAA8\uB4C8\uB85C \uAD6C\uC131\uB418\uC5B4 \uC788\uB294\uB370 3\uACFC\uC81C\uC758 \uCD1D\uD569 \uC810\uC218\uB85C \uB4F1\uC218\uB97C \uB9E4\uAE34\uB2E4. (60\uC810 \uB118\uAE30\uBA74 \uC7A5\uB824\uC0C1 \uD655\uC815) <br><br></p><p>4\uC6D4 8\uC77C \uB300\uD68C\uAC00 \uB05D\uC774 \uB098\uACE0 \uC2DC\uC0C1\uC2DD\uC774 \uC5F4\uB838\uB2E4. \uC120\uBC30\uB4E4\uC740 \uB2E4\uD589\uD788\uB3C4 \uAE08, \uB3D9\uBA54\uB2EC\uC744 \uC218\uC0C1\uD558\uC600\uACE0 \uB098\uB3C4 \uC81C \uC810\uC218\uB97C \uBCF4\uB2C8 \uC544\uC27D\uAC8C \uC57D 4\uC810 \uCC28\uC774\uB85C \uC7A5\uB824\uC0C1\uC870\uCC28 \uBC1B\uC9C0 \uBABB\uD588\uB2E4. \uADF8\uB54C\uB294 \uC120\uBC30\uB4E4 \uBA54\uB2EC\uC774 \uB530\uAC04 \uAC8C \uB0B4\uC2EC \uBD80\uB7EC\uC6B0\uBA74\uC11C\uB3C4 &quot;\uC870\uAE08\uB9CC \uB354 \uC5F4\uC2EC\uD788 \uD588\uB354\uB77C\uBA74 \uC7A5\uB824\uC0C1\uC774\uB77C\uB3C4 \uBC1B\uC744 \uC218 \uC788\uC5C8\uC744 \uD150\uB370&quot;\uB77C\uB294 \uC0DD\uAC01\uC774 \uC81C \uBA38\uB9BF\uC18D\uC744 \uAC00\uB4DD \uCC44\uC6E0\uB2E4. <br><br></p><h2 id="\uC9C0\uBC29\uB300\uD68C\uAC00-\uB05D\uB09C-\uD6C4" tabindex="-1">\uC9C0\uBC29\uB300\uD68C\uAC00 \uB05D\uB09C \uD6C4 <a class="header-anchor" href="#\uC9C0\uBC29\uB300\uD68C\uAC00-\uB05D\uB09C-\uD6C4" aria-hidden="true">#</a></h2><hr><p>\uC9C0\uBC29\uB300\uD68C\uAC00 \uB05D\uB09C \uD6C4 \uD3ED\uD48D\uC774 \uC9C0\uB098\uAC04 \uAC83\uCC98\uB7FC \uAE30\uB2A5\uBC18 \uC0DD\uD65C\uC740 \uB2E4\uC2DC \uD3C9\uD654\uB85C\uC6CC\uC84C\uB2E4. \uBD84\uC704\uAE30\uB3C4 \uC6D0\uB798\uB300\uB85C \uB3CC\uC544\uC654\uACE0 \uB098\uB294 \uADF8\uC800 \uC120\uBC30\uB4E4\uC774 \uB0B4\uC8FC\uB294 \uACFC\uC81C\uB97C \uD480\uBA74\uC11C \uD558\uB8E8\uD558\uB8E8\uB97C \uBCF4\uB0B4\uACE0 \uC788\uC5C8\uB2E4. \uADF8\uB807\uAC8C 1~2\uB2EC\uC774 \uC9C0\uB098\uACE0 \uC5EC\uB984\uBC29\uD559\uC5D0 <code>\uBBFC\uAC04\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C</code>\uAC00 \uC5F4\uB838\uB2E4. <br></p><p>\uBBFC\uAC04\uAE30\uB2A5\uACBD\uAE30\uB300\uD68C\uB77C\uACE0 \uBBFC\uAC04\uC774 \uC8FC\uB3C4\uD558\uB294 \uAE30\uB2A5\uB300\uD68C\uC778\uB370 \uC6F9\uB514\uC790\uC778 \uC9C1\uC885\uC740 2020\uB144\uC5D0 \uC2DC\uC791\uB418\uC5B4 \uC774\uB54C 2\uBC88\uC9F8\uB85C \uAC1C\uCD5C\uB418\uB294 \uB300\uD68C\uC600\uB2E4. \uC790\uC138\uD55C \uC124\uBA85\uC740 <a href="https://meister.hrdkorea.or.kr/sub/3/5/1/20160512112047538100_view.do" target="_blank" rel="noopener noreferrer">\uC774\uACF3</a>\uC73C\uB85C <br></p><p>\uC774\uB54C \uB2F9\uC2DC \uCF54\uB85C\uB098 \uD655\uC9C4\uC790\uAC00 \uB108\uBB34 \uB098\uC640\uC11C \uB300\uD68C\uB97C \uC628\uB77C\uC778\uC73C\uB85C \uAC1C\uCD5C\uD588\uB294\uB370 \uBD80\uC815\uD589\uC704\uB97C \uB300\uBE44\uD574\uC11C \uADF8\uB7F0 \uAC74\uC9C0 \uB300\uD68C \uBB38\uC81C\uB97C \uD574\uB2F9 \uB300\uD68C \uB2F9\uC77C \uACF5\uAC1C\uD558\uACE0 \uC778\uD130\uB137 \uAC80\uC0C9 \uD5C8\uC6A9\uC774\uC5C8\uB2E4. \uC774 \uB300\uD68C\uB294 \uC9C0\uBC29\uB300\uD68C\uCC98\uB7FC 60\uC810 \uC774\uC0C1\uBD80\uD130 \uC0C1\uC744 \uC8FC\uB294 \uAC8C \uC544\uB2C8\uACE0 \uC0C1\uC704 10\uBA85\uB9CC \uC0C1\uC744 \uC8FC\uB294\uB370 \uB098\uB294 \uB2E4\uD589\uD788 10\uB4F1 \uC548\uC5D0 \uB4E4\uC5B4 \uAE30\uB2A5\uB300\uD68C \uCC98\uC74C\uC73C\uB85C \uC774\uB54C \uC6B0\uC218\uC0C1\uC744 \uBC1B\uC558\uB2E4. <br><br></p><h2 id="\uAE30\uB2A5\uBC18-\uD6C4\uBC30\uB4E4\uC758-\uB4F1\uC7A5" tabindex="-1">\uAE30\uB2A5\uBC18 \uD6C4\uBC30\uB4E4\uC758 \uB4F1\uC7A5 <a class="header-anchor" href="#\uAE30\uB2A5\uBC18-\uD6C4\uBC30\uB4E4\uC758-\uB4F1\uC7A5" aria-hidden="true">#</a></h2><hr><p>\uBBFC\uAC04\uB300\uD68C\uAC00 \uB05D\uB09C \uD6C4 <code>1\uD559\uB144 \uC608\uBE44 \uAE30\uB2A5\uBC18</code>\uC744 \uBF51\uC558\uB2E4. 1\uD559\uB144 \uC608\uBE44 \uAE30\uB2A5\uBC18\uB3C4 \uCC98\uC74C\uC5D0\uB294 10\uBA85 \uC815\uB3C4 \uC788\uC5C8\uB294\uB370 \uC6B0\uB9AC \uB54C\uC640 \uB611\uAC19\uC774 \uD798\uB4E4\uB2E4\uACE0 \uB098\uAC00\uACE0 \uCAD3\uACA8\uB098\uACE0 \uADF8\uB7EC\uB2C8 \uB9C8\uC9C0\uB9C9\uC5D4 1\uBA85\uBC16\uC5D0 \uC548 \uB0A8\uC558\uB2E4. \uBB54\uAC00 \uAC00\uBA74 \uAC08\uC218\uB85D \uC810\uC810 \uC778\uC6D0\uC774 \uC904\uC5B4\uB4E4\uACE0 \uC788\uB2E4. \uC120\uBC30\uB4E4 \uAE30\uC218\uB294 3\uBA85, \uC6B0\uB9AC\uB4E4 \uAE30\uC218\uB294 2\uBA85, \uC774\uB54C 1\uD559\uB144\uC774 1\uBA85\uC774\uC5C8\uC73C\uB2C8.</p><p>(\uC194\uC9C1\uD788 \uAC1C\uC778\uC801\uC73C\uB85C \uAE30\uB2A5\uBC18 \uD558\uB294 \uAC8C \uB2E4\uB978 \uB3D9\uC544\uB9AC\uB4E4\uBCF4\uB2E4 \uC2E4\uB825\uB3C4 \uBE68\uB9AC \uB298\uACE0 \uD61C\uD0DD\uB3C4 \uB9CE\uC544\uC11C \uC88B\uC740\uB370 \uC65C \uC598\uB4E4\uC740 \uC548 \uD558\uB294 \uAC74\uC9C0 \uBAA8\uB974\uACA0\uB2E4.) <br><br></p><p>\uC774\uD6C4\uB85C\uB3C4 2\uCC28, 3\uCC28 \uC608\uBE44 \uAE30\uB2A5\uBC18\uC744 \uD588\uC5C8\uB294\uB370 \uAE30\uB2A5\uBC18\uC5D0 \uB4E4\uC5B4\uC624\uB824\uB294 \uC598\uB4E4\uC740 \uBCC4\uB85C \uC5C6\uC5C8\uB2E4. 2\uCC28, 3\uCC28\uAE4C\uC9C0 \uD558\uBA74\uC11C \uC5B4\uB5A4 \uD55C \uC598\uAC00 \uACC4\uC18D \uC9C0\uC6D0 \uD588\uB294\uB370 \uC2E4\uB825\uB3C4 \uBD80\uC871\uD558\uACE0 \uC81C\uC77C \uD070 \uC774\uC720\uB294 \uD3C9\uC18C \uD589\uB3D9\uC774 \uC548 \uC88B\uC544\uC11C \uB9E4\uBC88 \uC798\uB9B0\uAC74\uB370 \uC120\uC0DD\uB2D8\uC774 \uBC1B\uC544\uC8FC\uC154\uC11C \uC5B4\uCA54 \uC218 \uC5C6\uC774 \uAC19\uC774 \uAE30\uB2A5\uBC18\uC774 \uB418\uC5C8\uB2E4. <br><br><br><br> \uC6D0\uB798 \uD55C\uD3B8\uC5D0 \uB2E4 \uC4F8\uB824\uACE0 \uD588\uB294\uB370 \uAE00\uC774 \uB108\uBB34 \uAE38\uC5B4\uC838\uC11C 1\uD3B8\uC740 \uC5EC\uAE30\uAC00 \uB05D</p><br><br><hr><br>',61)),o(r)])}var f=a(b,[["render",l]]);export{m as __pageData,f as default};
